import React from 'react';
import { NavLinkLink } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul style={{ display: 'flex', listStyle: 'none', padding: 0 }}>
        <li style={{ marginRight: '20px' }}>
          <NavLink to="/about-me" className="hover-outline-link">
            About Me
          </NavLink>
        </li>
        <li style={{ marginRight: '20px' }}>
          <NavLink to="/get-in-touch" className="hover-outline-link">
            Get in Touch!
          </NavLink>
        </li>
        <li style={{ marginRight: '20px' }}>
          <NavLink to="/projects" className="hover-outline-link">
            Projects
          </NavLink>
        </li>
        {/* Add more links as needed */}
      </ul>
    </nav>
  );
}

export default Navbar;
